import {
  createBrowserRouter,
  RouterProvider,
  Navigate,
} from "react-router-dom";
import AllQuotes from "./components/quotes-test/AllQuotes.jsx";
import NewQuote from "./components/quotes-test/NewQuote.jsx";
import QuoteDetail from "./components/quotes-test/QuoteDetail.jsx";
import Layout from "./components/layout/Layout.jsx";
import NoQuotesFound from "./components/quotes/NoQuotesFound.jsx";
const router = createBrowserRouter([
  {
    path: "/",
    element: <Navigate to="/quotes" />,
    errorElement: <NoQuotesFound />,
  },
  {
    path: "/",
    element: <Layout />,
    errorElement: <NoQuotesFound />,
    children: [
      { path: "/quotes", element: <AllQuotes /> },
      { path: "/quotes/:quoteId", element: <QuoteDetail /> },
      { path: "/new-quote", element: <NewQuote /> },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
